import React from 'react'
import NavBar from '../navBar/NavBar'
import Header from '../header/Header'

const Home = ({ languages }) => {
  return (
    <div className="appBar">
        <NavBar/>
        <Header languages={languages} />
    </div>
  )
}

export default Home
